import React from "react";
import Landing from './components/Landing/Landing';





function App() {
  return (
      <BrowserRouter> 
          <Switch> 
          <Route exact path='/' component={Landing} /> 
          <Route exact path='/videogames' component={Videogames} />
          </Switch>
      </BrowserRouter>
  );
}

export default App;
